import React from 'react';
import { useHistory } from 'react-router-dom';
import './landing.css'; // you can customize this if needed

const Landing = () => {
  const history = useHistory();

  return (
    <div className="landing-container">
      <h1>Welcome to Phishing Detector</h1>
      <p>Start by signing up or continue without saving your analysis</p>
      <div className="landing-buttons">
        <button onClick={() => history.push('/signup')}>Sign Up</button>
        <button onClick={() => history.push('/email-input')}>Continue Without Signing Up</button>
      </div>
    </div>
  );
};

export default Landing;
